import Login from "./Pages/Login";

var routes = [
    { path: "/", name: window.location.pathname, component: Login, layout: "/" },
    { path: "/", name: window.location.pathname, component: Login, layout: "/auth" },
    
    { path: "/login", icon: "fa fa-home", name: "Login", component: Login, layout: "/auth" },
    { path: "/register", icon: "fa fa-home", name: "Register", component: Login, layout: "/auth" },
    { path: "/Forget", icon: "fa fa-home", name: "Forget", component: Login, layout: "/auth" },
    { path: "/Dashboard", icon: "fa fa-home", name: "Dashboard", component: Login, layout: "/auth" },
    { path: "/Landing", icon: "fa fa-home", name: "Landing", component: Login, layout: "/agent" },
    
];
export default routes;
